import React from 'react'
import styled from "styled-components";
function Header() {
    return (
        <Container>
               <img  src="/images/logo.svg" alt=""/>
               <Elements>
                 <p> <a href="#">ModelS</a> </p>
                 <p> <a href="#">Model3</a> </p>
                 <p> <a href="#">ModelX</a> </p>
                 <p> <a href="#">ModelY</a> </p>
                 <p> <a href="#">Solor Roof</a></p>
                 <p> <a href="#">Solor Panel</a></p>
               </Elements>
        </Container>
    )
}

export default Header

const Container = styled.div `
    max-width:60px;
    position:fixed;
    padding:20px ;
    display-flex;
    top:0;
    bottom:0;
    left:0;
    align-items:center;

`
const Elements = styled.div `
   display:flex;
   justify-content:center;
   align_items:center;

   p {
       
   }

`
